import React, { useState } from "react";

function CreateArea(){



    return (
    <div>
        <form>
            <input 
                name="title" 
                onChange={handleChange}
                placeholder="Title" 
                value={note.Title} 
            />
            <textarea 
                name="content" 
                onChange={handleChange}
                placeholder="Take a note!" 
                value={note.Content} 
                rows="3" 
            />
            <button onClick={submitNote}>Add</button>
        </form>
    </div>
    )
}

export default CreateArea;
